wikitext.*:
/* Personal Stylesheets */
/* Contents */
.infoBox.infobox-incompleted, .editnotice-namespace {
    display: none !important;
}
.heimu, .heimu a, a .heimu, .heimu a.new {
    background-color: #333;
    color: #ccc;
}
#mw-panel {
    background-color: rgba(251,251,251,0.02) !important;
}
/* Footer */
.moegirl_rating, .comment-container-top, .comment-container, .comment-replybox, .comment-paginator, .comment-bannotice {
    display: none !important;
}
#footer-moegirl ul {
    display: none;
}
#footer-info-copyright {
    background: none;
}
#footer-info-copyright span.copyright {
    text-align: center;
}
